pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.5/interfaces/AggregatorV2V3Interface.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v3-core/contracts/libraries/SafeCast.sol";
import "./libraries/TickMath.sol";
import './libraries/UQ112x112.sol';
import "./interfaces/IPrice.sol";

contract Price is IPrice {

    using SafeMath for uint256;
    using SafeCast for uint256;
    using UQ112x112 for uint224;

    struct ChainLinkInfo {
        address oracle;
        uint8 decimals;
    }

    struct V2Info {
        uint32 timestampOld;
        uint256 priceCumulativeOld;
        uint256 priceOld;
        int8  precisionDiff;
        address oracle;
        bool reverse;
    }

    struct V3Info {
        int8  precisionDiff;
        address oracle;
        bool reverse;
    }

    using SafeMath for uint256;

    mapping(address => uint8) public override oracleTypes;
    mapping(address => ChainLinkInfo) public override chainLinkOracles;
    mapping(address => V2Info) public override v2Oracles;
    mapping(address => V3Info) public override v3Oracles;

    uint32[] private _secondsAgo;
    uint32 private constant OBSERVE_TIME_INTERVAL = 60;

    uint256 private constant E18 = 1e18;
    uint256 private constant E28 = 1e28;
    uint256 private constant E38 = 1e38;
    uint256 private constant E58 = 1e58;

    constructor() {
        _secondsAgo = [OBSERVE_TIME_INTERVAL, 0];
    }

    function setPool(address oracle, uint8 typ, bool reverse) external override {
        require(typ == 1 || typ == 2 || typ == 3 , "unknown typ");
        oracleTypes[msg.sender] = typ;

        if (typ == 1) {
            chainLinkOracles[msg.sender] = ChainLinkInfo(oracle, AggregatorV2V3Interface(oracle).decimals());
        }

        if (typ == 2 || typ == 4) {
            IUniswapV2Pair pair = IUniswapV2Pair(oracle);
            address token0 = pair.token0();
            address token1 = pair.token1();
            int8 precisionDiff = int8(ERC20(token0).decimals()) - int8(ERC20(token1).decimals());

            uint112 reverse0;
            uint112 reverse1;
            uint32 timestampOld;
            uint256 priceCumulativeOld;
            uint256 priceOld;

            (reverse0, reverse1, timestampOld) = pair.getReserves();
            require(reverse0 > 0 && reverse1 > 0, "not init");

            if (reverse) {
                priceCumulativeOld = pair.price1CumulativeLast();
                priceOld = uint256(reverse0).mul(E18) / reverse1;
            } else {
                priceCumulativeOld = pair.price0CumulativeLast();
                priceOld = uint256(reverse1).mul(E18) / reverse0;
            }

            if (precisionDiff > 0) {
                priceOld = priceOld.mul(10**uint8(precisionDiff));
            } else {
                priceOld = priceOld / 10**uint8(-precisionDiff);
            }

            v2Oracles[msg.sender] = V2Info(timestampOld, priceCumulativeOld, priceOld, precisionDiff, oracle, reverse);
        }

        if (typ == 3) {
            address token0 = IUniswapV3Pool(oracle).token0();
            address token1 = IUniswapV3Pool(oracle).token1();
            int8 precisionDiff = int8(ERC20(token0).decimals()) - int8(ERC20(token1).decimals());
            v3Oracles[msg.sender] = V3Info(precisionDiff, oracle, reverse);
        }

    }

    function getPrice() external override view returns (uint256) {

        uint8 typ = oracleTypes[msg.sender];

        if (typ == 1) {
            _getPriceChainLink();
        } else if (typ == 2) {
            (, , uint256 price) = _getPriceV2();
            return price;
        } else if (typ == 3) {
            return _getPriceV3();
        }

        return 0;
    }

    function getPriceAndUpdate() external override returns (uint256) {
        uint8 typ = oracleTypes[msg.sender];

        if (typ == 1) {
            _getPriceChainLink();
        } else if (typ == 2) {
            (uint256 priceCumulativeLast, uint32 timestampLast, uint256 price) = _getPriceV2();
            _updatePriceV2(priceCumulativeLast, timestampLast, price);
            return price;
        } else if (typ == 3) {
            return _getPriceV3();
        }

        return 0;
    }

    function _getPriceChainLink() internal view returns (uint256) {
        ChainLinkInfo memory info = chainLinkOracles[msg.sender];
        uint256 price = uint256(AggregatorV2V3Interface(info.oracle).latestAnswer());

        return price * (10 ** (18 - info.decimals));
    }

    function _getPriceV2() internal view returns (uint256 priceCumulativeLast, uint32 , uint256 price) {
        V2Info memory info = v2Oracles[msg.sender];

        IUniswapV2Pair pair = IUniswapV2Pair(info.oracle);
        (uint112 _reserve0, uint112 _reserve1, uint32 timestampLast) = pair.getReserves();

        uint32 blockTimestamp = uint32(block.timestamp % 2**32);
        if (blockTimestamp == info.timestampOld) {
            return (info.priceCumulativeOld, blockTimestamp, info.priceOld);
        }

        if (info.reverse) {
            priceCumulativeLast = pair.price1CumulativeLast();
            if (timestampLast < blockTimestamp) {
                priceCumulativeLast = priceCumulativeLast.add(uint(UQ112x112.encode(_reserve0).uqdiv(_reserve1)) * (blockTimestamp - timestampLast));
            }
        } else {
            priceCumulativeLast = pair.price0CumulativeLast();
            if (timestampLast < blockTimestamp) {
                priceCumulativeLast = priceCumulativeLast.add(uint(UQ112x112.encode(_reserve1).uqdiv(_reserve0)) * (blockTimestamp - timestampLast));
            }
        }

        uint256 priceX112 = priceCumulativeLast.sub(info.priceCumulativeOld) / (blockTimestamp - info.timestampOld);

        if (priceX112 > E58) {
            price = (priceX112 >> 112).mul(E18);
        } else {
            price = (priceX112.mul(E18)) >> 112;
        }

        if (info.precisionDiff > 0) {
            price = price.mul(10**uint8(info.precisionDiff));
        } else {
            price = price / 10**uint8(-info.precisionDiff);
        }

        if (price == 0) {
            price = 1;
        }

        return (priceCumulativeLast, blockTimestamp, price);
    }

    function _getPriceV3() internal view returns (uint256) {
        V3Info memory info = v3Oracles[msg.sender];

        (int56[] memory tickCumulatives, ) = IUniswapV3Pool(info.oracle).observe(
            _secondsAgo
        );
        uint256 sqrtPriceX96 = uint256(
            TickMath.getSqrtRatioAtTick(
                int24((tickCumulatives[1] - tickCumulatives[0]) /
                int56(int32(OBSERVE_TIME_INTERVAL)))
            )
        );
        uint256 price;
        if (sqrtPriceX96 > E38) {
            price = (sqrtPriceX96 >> 96).mul((sqrtPriceX96.mul(E18)) >> 96);
        } else if (
            info.precisionDiff > 0 &&
            sqrtPriceX96 < E28.div(10**(uint256(uint8(info.precisionDiff)).div(2)))
        ) {
            price =
            (
            sqrtPriceX96.mul(sqrtPriceX96).mul(E18).mul(
                10**uint256(uint8(info.precisionDiff))
            )
            ) >>
            192;
        } else if (sqrtPriceX96 < E28) {
            price = (sqrtPriceX96.mul(sqrtPriceX96).mul(E18)) >> 192;
        } else {
            price = (((sqrtPriceX96.mul(sqrtPriceX96)) >> 96).mul(E18)) >> 96;
        }

        if (info.precisionDiff > 0) {
            if (sqrtPriceX96 > E28.div(10**(uint256(int256(info.precisionDiff)).div(2)))) {
                price = price.mul(10**uint256(int256(info.precisionDiff)));
            }
        } else if (info.precisionDiff < 0) {
            price = price.div(10**uint256(-int256(info.precisionDiff)));
        }
        if (price == 0) {
            price = 1;
        }
        if (info.reverse) {
            price = _priceReciprocal(price);
        }
        if (price == 0) {
            price = 1;
        }
        return price;
    }

    function _updatePriceV2(uint256 priceCumulativeLast, uint32 timestampLast, uint256 price) internal {
        V2Info memory info = v2Oracles[msg.sender];

        if (timestampLast == info.timestampOld) {
            return;
        }

        info.priceCumulativeOld = priceCumulativeLast;
        info.timestampOld = timestampLast;
        info.priceOld = price;
        v2Oracles[msg.sender] = info;
    }

    function _priceReciprocal(uint256 originalPrice) internal pure returns (uint256)
    {
        uint256 one = E18**2;
        uint256 half = originalPrice.div(2);
        return half.add(one).div(originalPrice);
    }
